Device Monitor² is a unique app of its kind, optimized for iPhone, iPod Touch, iPad and Mac (with M1 processor and later), which allows you to have at a glance all the information on the device currently in use in a simple and fast way. You'll be able to better understand which sensors apps have access to, so you can protect your privacy.

Here are the main features that will prompt you to choose Device Monitor²:
• display of data in a simple and easy to understand form;
• information on the DEVICE;
• information on SENSORS;
• information on RAM (with the possibility of freeing it);
• information on STORAGE;
• information about the CPU;
• information on the NETWORK;
• information on the BATTERY;
• information on the DISPLAY;
• information on the CAMERA;
• widget for the Lock Screen (requires iOS 16), for the Home Screen (requires iOS 14) and for the Notification Center (iOS 13), with the possibility of customizing the interface;
• possibility to free the RAM with a simple button or using your voice thanks to Siri Shortcuts.

In addition, thanks to in-app purchases you can have many other features available:
• PRO Kit:
   - unlock all features available with other in-app purchases (present and future):
   - RAM deep cleaning:
   - copy&paste of the data displayed in the app;
• Test Kit:
   - complete check-up of many sensors of your device, including:
       → GPS;
       → COMPASS;
       → ALTIMETER;
       → ACCELEROMETER;
       → MAGNETOMETER;
       → GYRO;
       → BAROMETER;
       → DEVICE MOTION;
       → MOTION COPROCESSOR;
       → PEDOMETER;
       → BLUETOOTH;
       → IBEACON;
       → MICROPHONE;
       → PROXIMITY SENSOR;
       → NFC;
       → VIBRATION and HAPTIC FEEDBACK;
       → PING;
       → ACID3;
       → SPEED TEST;
       → NETWORK DEVICE SCANNER;
       → MULTITOUCH;
       → BRIGHTNESS;
       → SCREEN COLOR;
       → CAMERA;
       → FLASH;
• Report Kit:
   - export of the data displayed inside the app in a convenient PDF document;
• Notification Kit:
   - receive a notification every time the RAM memory is too full (parameter configurable from the app settings);
   - receive a notification whenever the device temperature is too high (parameter configurable from the app settings);
• Ads Kit:
   - no more advertising within the app.


We also want to tell you that the app does not collect any personal data, but not even non-personal data. Because? Simple, because we don't care!
Oh and let's not forget that the app is FREE.

Realremote.io is a platform for finding fully remote, exclusive and verified job offers, specializing in software development and design. 

Here is what we do differently: 
1)	We search through many job-focused online communities;
2)	We hand-pick exclusive, fully-remote job offers;
3)	We turn them into curated job applications;

The main difference between other job-posting websites and RealRemote is the fact that the job offers posted on here are verified, and connect potential employers directly to company management, since dealing with HR bureaucracy on most Job listing sites is something many of us would rather avoid. We realized multiple, exclusive and job-focused online communities that we found throughout our careers are far better places to directly reach company management for real and up-to-date job offers. However, access to these channels is limited, it takes time, experience and trust. We hand-pick curated offers and turn them into job applications, so our users don’t have to go through the bureaucracy of recruiters or chaos of group chats.

You are the best developer in the world and you would like to code anytime, anywhere. InstantCoder makes it possible for you to code apps on your lovely iPhone and iPad.

Features
- Syntax highlighting supporting all mainstream programming languages: css, js, html, swift, objective-c, c/c++, java, python, etc;
- Autosave changes;
- run code snippets in python, js, java, r, c/c++, lua and ruby;
- Realtime preview for web applications with built-in web server;
- Zip/unzip folder;
- Upload and download files with HTTP directly to and from your devices;
- Upload code and resources from the browser through HTTP;
- Sync your source code among multiple devices via the Cloud service you choose;
